import React from 'react';

const VideoDetails = ({ video }) => {
    if(!video) {
        return <div>Loading error...</div>
    }
    
    return (
        <div>{video.snippet.title}</div>
        // <div>{video.snippet.description}</div>
    )
        
};

export default VideoDetails;
